import React, { useEffect, useState } from 'react'
import Card  from './Card'
import axios from 'axios'
function Products() {
    const [products, setproducts] = useState([])

    useEffect(()=>{
        axios.get('https://fakestoreapi.com/products')
        .then((productsData)=>{
            setproducts
        })
    } , [])

  return (
    <Card/>
  )
}

export default Products
